import React from 'react';
import Button from '@mui/material/Button';

function App() {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Hello React + Material-UI!</h1>
      <Button variant="contained" color="primary">
        Click me
      </Button>
    </div>
  );
}

export default App;
